import React, { useState, useEffect } from 'react';
import axios from 'axios';

const Trending = () => {
  const [trendingData, setTrendingData] = useState([]);

  useEffect(() => {
    fetchTrendingData();
  }, []);

  const fetchTrendingData = async () => {
    try {
      const response = await axios.get('https://api.example.com/trending');
      setTrendingData(response.data);
    } catch (error) {
      console.error('Error fetching trending data:', error);
    }
  };

  return (
    <div>
      {trendingData.map((item) => (
        <div className="card bg-dark text-white" key={item.id}>
          <img className="card-img" src={item.poster_url} alt="Card image" />
          <div className="card-img-overlay">
            <h5 className="card-title">{item.title}</h5>
            <p className="card-text">{item.description}</p>
            <p className="card-text">Release Date: {item.release_date}</p>
            <p className="card-text">Age Rating: {item.age_rating}</p>
            <p className="card-text">Ticket Price: {item.ticket_price}</p>
          </div>
        </div>
      ))}
    </div>
  );
};

export default Trending;
